import { Component } from "react";
import Link from 'next/link'
class Index extends Component {
    constructor(props) {
        super(props)
    }
    render () {
        return (
           <div>
               <h1>Vel Thunai</h1>
               <Link href="/about" title="About Page"><a>Navigate to About</a></Link>
           </div>
        )
    }
}

export default Index;
